import React from 'react';

function Footer() {
  return (
    <footer>
      <div className="footer-content">
        <p>&copy; 2023 Your Name. All rights reserved.</p>
        <div className="social-links">
          <a href="https://www.linkedin.com/in/your-profile" target="_blank" rel="noopener noreferrer">LinkedIn</a>
          <a href="https://www.facebook.com/your-profile" target="_blank" rel="noopener noreferrer">Facebook</a>
          <a href="https://twitter.com/your-profile" target="_blank" rel="noopener noreferrer">Twitter</a>
          <a href="https://www.instagram.com/your-profile" target="_blank" rel="noopener noreferrer">Instagram</a>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
